import React from "react";
import { Event } from "../types";

interface EventMarkerProps {
  isActive: boolean;
  onClick: () => void;
}

const EventMarker: React.FC<EventMarkerProps> = ({ isActive, onClick }) => {
  return (
    <div
      className={`dots ${isActive ? "active" : ""}`}
      onClick={onClick}
      style={{
        width: "20px",
        height: "20px",
        borderRadius: "50%",
        backgroundColor: isActive ? "blue" : "black",
        cursor: "pointer",
      }}
    />
  );
};

export default EventMarker;
